import React from "react";

const Featured = () => {
  return (
    <React.Fragment>
      <section>
        <h1>Featured</h1>
        <div className="line" />
        <div className="grid-container">
          <div className="grid-item">
            <div className="pic" />
            <p className="name">Lavendar Soap</p>
            <p className="price">$230</p>
          </div>
          <div className="grid-item">
            <div className="pic" />
            <p className="name">Rose Soap</p>
            <p className="price">$230</p>
          </div>
          <div className="grid-item">
            <div className="pic" />
            <p className="name">Sweet Orange Soap</p>
            <p className="price">$230</p>
          </div>
        </div>
      </section>

      <style jsx>{`
        section {
          height: 470px;
        }

        h1 {
          text-align: center;
          font-size: 3rem;
          margin-top: 1em;
        }

        .line {
          width: 70px;
          border-bottom: 4px solid #af9b7d;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Featured;
